import RandomNumberGame from './component/RandomQuestion/RandomNumberGame'
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import './App.css';

function App() {
  return (
    <>
     <div className="App">
     <Navbar className="bg-body-tertiary">
                <Container>
                    <Navbar.Brand href="#home">
                        <img
                            alt=""
                            src="/img/logo.svg"
                            width="30"
                            height="30"
                            className="d-inline-block align-top"
                        />{' '}
                        React Bootstrap
                    </Navbar.Brand>
                </Container>
            </Navbar>
      <h1>Random Number Game</h1>
      <RandomNumberGame />
    </div>
    </>
  );
}

export default App;
